import React from 'react'
import './App.css';
import { Route, Routes } from 'react-router-dom';
import { Box } from '@mui/material';




const app = () => {
  return (
    <Box width="400px" >
    <Navbar />
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/exercise/:id" element={<ExerciseDetail />} />
    </Routes>
    <Footer />
  </Box>
  )
}

export default app
